import React, {Component } from 'react';
import { gql } from 'apollo-boost';
import { graphql } from '@apollo/react-hooks';

const getMembersQuery = gql`
    members{
        name
        id
    }
`

class MemberList extends Component{
    render(){
        return(
            <div>
                <ul id='member-list'>
                    <li>member name</li>
                </ul>
            </div>
        )
    }
}

export default graphql(getMembersQuery()(MemberList))
